import styled from "styled-components";

export const Head = styled.header`
  color: red;
  border:1px solid red;
  height:89px;
  display:flex;
  justify-content:space-between;
  align-items:center;
`;
export const Logo = styled.a`
  color: red;
  border:1px solid red;
  height:20px;
  width:100px;
  & img{
    border:1px solid red;
    height:100%;
    width:100%;
  }
`;
